{"__input_ext": "tabular", "__workflow_invocation_uuid__": "456e7fe2f37911ee99c9001e67d2ec02", "chromInfo": "/data/db/reference_genomes/hg38/len/hg38.len", "code": "(NR==1){
    for (i=1;i<=NF;i++) {
        if ($i ~ "gene1") { 
            gene1 = i;
        }
        if ($i == "gene2") { 
            gene2 = i;
        }
        if ($i == "breakpoint1") { 
            breakpoint1 = i;
        }
        if ($i == "breakpoint2") { 
            breakpoint2 = i;
        }
        if ($i == "reading_frame") { 
            reading_frame = i;
        }
        if ($i == "peptide_sequence") { 
            pscol = i;
        }
    }
}
(NR>1){
    pseq = $pscol
    if (pseq != ".") {
        bp = index(pseq,"|");
        pos = bp - 8; 
        n=split(pseq,array,"|");
        pep = toupper(array[1] array[2])
        sub("[*]","",pep)
        g1 = $gene1;
        g2 = $gene2;
        sub("[(,].*","",g1);
        sub("[(,].*","",g2);
        id = g1 "_" g2
        brkpnts = $breakpoint1 "_" $breakpoint2 
        neopep = substr(pep,pos)
        if ($reading_frame == "in-frame") {
            neopep = substr(pep,pos,16)
        }
        print(id "\t" (NR-1) "\t" brkpnts "\t" neopep);  
    }
} ", "infile": {"__class__": "ConnectedValue"}, "__page__": null, "__rerun_remap_job_id__": null}

